rules_version = '2';
service cloud.firestore {
  match /databases/{database}/documents {
    match /{document=**} {
      allow read, write: if true;
    }
  }
}

import type { Config } from 'jest';

const config: Config = {
  testEnvironment: 'node',
};

export default config;

